import Link from 'next/link';

const Nav = () => {
  return (
    <div>
      <Link href='/'>
        <a className='home'>Home</a>
      </Link>
      <Link href='/about'>
        <a className='about'>About</a>
      </Link>
      <style jsx>{`
        a {
          color: #555;
          text-decoration: none;
          padding: 10px 20px;
          display: inline-block;
          background: white;
          border: 1px solid gray
        }
      `}</style>
    </div>
  );
}

export default Nav;
